  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-10 col-md-10 mx-auto mt-3 bg-info">
            <div className="row">
              <DishCard />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Dish;
